window.bookSummaryJSON = "<p>A tormented dragon prince. A captured elven assassin. Duty demands they fight for their people, but love has other plans. </p> <p>Eroan, one of the last elven assassins, lives for one purpose: Kill the queen. </p> <p>He would have succeeded if not for her last line of defense: Prince Lysander. Now, captured and forced into the queen's harem, Eroan sees another opportunity. Why kill just the queen when he can kill them all? It would be simple, if not for the troubled and alluring dragon prince. A warrior, a killer, and something else...something Eroan finds himself inexplicably drawn to.</p>"; 
